    // =============== models ===============

    // seq length = nCodon * 3
    public BEASTObject[] initF3X4(int nTaxa, int nCodon, boolean symmetric, boolean verbose) {
        Alignment data = null;

        try {
            if (origAlig == null)
                data = getAlig128T500Codons(nTaxa, nCodon);
            else {
                data = filterAlig(origAlig, nTaxa, nCodon);
            }
        } catch (XMLParserException e) {
            e.printStackTrace();
        }

        // create Codon Alignment
        CodonAlignment codonAlignment = new CodonAlignment();
        codonAlignment.initByName("data", data, "dataType", "codon",
                "geneticCode", "vertebrateMitochondrial", "verbose", verbose);

//        String pi = "F3X4";
        SiteModel siteModel = getSiteModel(codonAlignment,"F3X4","0.3", "5", verbose);

        Tree tree = getTree(data, symmetric, false);
        // java tree likelihood only
        System.setProperty("java.only","true");

        return new BEASTObject[]{codonAlignment, siteModel, tree};
    }

    public SiteModel getSiteModel(CodonAlignment codonAlignment, String pi, String omegaValue, String kappaValue, boolean verbose) {
        CodonFrequencies codonFreq = new CodonFrequencies();
        codonFreq.initByName("pi", pi, "data", codonAlignment, "verbose", verbose);

        RealParameter omega = new RealParameter(omegaValue);
        RealParameter kappa = new RealParameter(kappaValue);

        M0Model m0 = new M0Model();
        m0.initByName("omega", omega, "kappa", kappa, "frequencies", codonFreq, "verbose", verbose);

        SiteModel siteModel = new SiteModel();
        siteModel.initByName("substModel", m0);

        return siteModel;
    }

    // =============== data ===============
    public Alignment getAligFrom(String fileName) throws XMLParserException, IOException {
        String xml = "";
        BufferedReader fin = new BufferedReader(new FileReader(fileName));
        while (fin.ready()) {
            xml += fin.readLine();
        }
        fin.close();

        // parse the xml
        XMLParser parser = new XMLParser();
        BEASTInterface beastObject = parser.parseFragment(xml, true);

// find relevant objects from the model
        Alignment data = getAlignment(beastObject);
        if (data == null)
            throw new IllegalArgumentException("No alignment found in file. Giving up now.");

//        Alignment data = ((Input<Alignment>) treeLikelihood.getInput("data")).get();
        int tipCount = data.getTaxonCount();
        int siteCount = data.getSiteCount();
        System.out.println("Load original alignment from " + fileName +
                " : tips = " + tipCount + ", nucleotides = " + siteCount);

        return data;
    }
    //find a Alignment object among the plug-ins by recursively inspecting plug-ins *
    private Alignment getAlignment(BEASTInterface beastObject)  {
        for (BEASTInterface beastObject2 : beastObject.listActiveBEASTObjects()) {
            if (beastObject2 instanceof Alignment) {
                return (Alignment) beastObject2;
            } else {
                Alignment alignment = getAlignment(beastObject2);
                if (alignment != null) {
                    return alignment;
                }
            }
        }
        return null;
    }

    public Alignment filterAlig(Alignment data, int nTaxa, int nCodon) {
        int tipCount = data.getTaxonCount();
        int siteCount = data.getSiteCount();
        //subset
        if (nTaxa < tipCount || nCodon * 3 < siteCount) {
            List<Sequence> sequenceList = data.sequenceInput.get();
            List<Sequence> newSeqs = new ArrayList<>();
            for (int i = 0; i < sequenceList.size(); i++) {
                Sequence sequence = sequenceList.get(i);
                String taxon = sequence.getTaxon();
                String seq = sequence.getData();
                assert seq.length() % 3 == 0;
                // t128
                int ind = Integer.parseInt(taxon.substring(1));

                if (ind <= nTaxa) {
                    if (nCodon * 3 < siteCount) {
                        // chop length = nCodon * 3
                        seq = seq.substring(0, nCodon*3);
                    }
                    newSeqs.add(new Sequence(taxon, seq));
                }
            }
//            System.out.println("Filtered alignment: tips = " + data.getTaxonCount() + ", nucleotides = " + data.getSiteCount());

            return new Alignment(newSeqs, data.getDataType().toString());
        } else {
            return new Alignment(data.sequenceInput.get(), data.getDataType().toString());
        }
    }

